window.bookSummaryJSON = "<p><b>From gamer to battlefield commander, the war grows!</b></p> <p>Recruited from Earth and tasked with putting his gaming skills to work commanding vast fleets of starships, Evan secured a victory considered impossible. Now, the Hegemony is asking him to repeat that accomplishment before the deadly forces of the Children consume their empire.</p> <p>Whilst searching for a suspected enemy base, Evan discovered a secret the Children are desperate to hide. One that will determine the entire course of the war. Victory will require winning in an entirely new theatre of battle.</p> <p>With a new suite of units at his fingertips, the ground assault begins!</p>"; 
